import React, { Component } from "react";

export default class Footer extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const { companyName, copyRight } = this.props;
    return (
      <div>
        <p>Powered By {companyName} | Contact me : bump@ogs</p>
        <p>{copyRight}</p>
      </div>
    );
  }
}
